import React from "react";
import ReactDom from "react-dom";
var name="jawad";
ReactDom.render(
  <React.Fragment>
    <p>My name is {name}</p>
    <p>{Math.ran}</p>
  </React.Fragment>,
  document.getElementById("root")
);
